import React from "react";
import "./Shared.css";

export const Footer: React.FC = () => {
    return (
      <div>
        <a href="index.htm">
            <img id="logo_large" src="CSD_www.png" />
        </a>
        <div className="link">
            <a href="https://www.csd.red">www.csd.red</a>
        </div>
      </div>
    );
};
